package rigabe 

import (
	"net/http"
	"net/http/httptest"
	"testing"
	"strings"
	"log"
	"encoding/json"
)

const img = `{ "image": "" }`

func TestRigabe(t *testing.T) {
	bodyReader := strings.NewReader(img)
	rr := httptest.NewRecorder()
	req := httptest.NewRequest("POST", "/", bodyReader)
	Rigabe(rr, req)

	var response Response
	if err := json.NewDecoder(rr.Body).Decode(&response); err != nil {
		log.Fatalln(err)
	}

	if rr.Result().StatusCode != http.StatusOK {
		t.Errorf("StatusCode = %v, want %v", rr.Result().StatusCode, http.StatusOK)
	}

	if len(response.Color) != 3 {
		t.Errorf("Should return 3 colors by returned = %v", len(response.Color))
	}
}
